import countriesJson from "../countries.json";

const Selector = () => {
    countriesJson.map((country) =>
        console.log(country)
    )
    return (
        <div>
            <select>
                {countriesJson.map((country) =>
                    console.log(country.Country)
                )}
            </select>
        </div>
    );
};

export default Selector;
